import React, {Router} from 'react'
import {Link} from "react-router-dom"
import {withChartContext} from "./DataProvider"

function BlsLink(button) {
    console.log({button})
    return (
        <button onClick={this.handleClick}><Link to={{
            pathname: `/study/${button.series_id}`,
            state:{button}
         }}>{button.title}</Link></button>
    )
}

export default withChartContext(BlsLink)
